import React from 'react';
import Sidebar from './components/Sidebar';
import Navbar from './components/Navbar';
import MainPage from './MainPage';

const App = () => {
  return (
    <div className="flex bg-gray-900 min-h-screen">
      <Sidebar />
      <div className="flex-1">
        <Navbar />
        <MainPage />
      </div>
    </div>
  );
};

export default App;
